class Solution(object):    def wordBreak(self, s, wordDict):        """        :type s: str        :type wordDict: List[str]        :rtype: bool        """        n=len(s)        dp=[False for i in range(n+1)]        dp[0]=True        for i in range(1,n+1):            for j in range(i):                if s[j:i] in wordDict:                    if dp[j]==True:                        dp[i]=True                        break        return dp[n]s1 = "leetcode"wordDict = ["leet", "code"]s=Solution()print(s.wordBreak(s1,wordDict))#如果s[j:i]在words中dp[i]=dp[j]#leet i=4的时候表示字符串长度为4的时候s[0:3]leet 在words中